import React from 'react';

const ComputerScience = () => {
  return (
    <div className="Computer-science">
      <div className="Cs-projects">
      <ul>
      <li><a href="https://gentle-woodland-96355.herokuapp.com/" style="font-family: Arial;color:#3a3642;font-size: 20px;">Student Outreach Database (PSQL/PHP/HTML) - used for Westmont College ministry teams to monitor participation</a></li>
      <li><a href="https://devpost.com/software/sbtrax-v486h7" style="font-family: Arial;color:#3a3642;font-size: 20px;">SB Trax</a> - an Android app that provides helpful information about hiking in Santa Barbara and includes interactive safety features</li>
      <li>Evolutionary Algorithm (Java) - worked with a team of 15 students to create an algorithm that measures
         the fitness of a population over time</li>
      <li>Wellness Running Log  (Java/MySQL) - built an application to track runs and measure physical and mental wellness</li>
      <li><a href="networks.html" style="font-family: Arial;color:#5D586B;font-size: 20px;">Aesthetic Networking</a></li>
      <li>This website (HTML/CSS/Javascript)</li>
    </ul>
      </div>
    </div>
  );
}
export default ComputerScience
